import axios from 'axios'

const baseUrl = 'https://api.jsonserve.com/sIHs1o'

const getAll = () => {
  const request = axios.get(baseUrl)
  return request.then(response => response.data)
}

const exportedObject = {
  getAll
}
export default exportedObject
